*/

// @mui material components
// import Card from "@mui/material/Card";
// import Grid from "@mui/material/Grid";
// import {Link} from 'react-router-dom';
// Soft UI Dashboard PRO React components
// import SuiBox from "components/SuiBox";
// import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";

import 'bootstrap/dist/css/bootstrap.min.css';
// import { F } from 'react-bootstrap';

// import Userclient from "layouts/dashboards/userclient/Userclient";

function Sidemenu() {
    return (
        <DashboardLayout>
            <DashboardNavbar />
            {/* <SuiTypography variant="h1" fontWeight="medium" style={{ textAlign: 'center' }}>
                User
            </SuiTypography> */}

            <div>
                <ul style={{height: '20px'}}>
                    <i style={{fontSize:'24px', color: 'white' }} className="fa"></i>
                    <a href="/user/edit/432847">Edit User Profile</a>
                </ul>

                <ul style={{height: '20px'}}>
                    <i style="font-size:17px;color:white;" className="fa"></i>
                    <a href="/user/update/432847">Update User Settings</a>
                </ul>

                <ul style={{height: '20px'}}>
                    <i style= {{fontSize: '17px' , color: 'white' }} className="fa"></i>
                    <a href="/idealassetallocation/add/432847">Update Ideal Asset Allocation</a>
                </ul>

                <ul style="height:20px;">
                    <i style= {{fontSize: '17px' , color: 'white'}}className="fa"></i>
                    <a href="/insurance/uploadfiles/432847">Upload Insurance file(s)</a>
                </ul>

                <ul style= {{height: '20px'}}>
                    <i style={{fontSize: '17px' , color: 'white' }} className="fa"></i>
                    <a href="/user/addfamily/432847">Add Family Member</a>
                </ul>

                <ul style={{height: '20px' }}>
                    <i style={{fontSize: '17px' , color: 'white'}} className="fa"></i>
                    <a href="/user/makehead/432847">Make Family Head</a>
                </ul>

                <ul style={{height: '20px' }}>
                    <i style={{fontSize: '17px' , color: 'white'}} className="fa"></i>
                    <a href="/user/mergeclient/432847">Merge Client</a>
                </ul>


            </div>

            <Footer />
        </DashboardLayout>
    );
}

export default Sidemenu;
